  false,\n\t\"url\": null,\n\t\"notes\": \"Midway Atoll National Wildlife Refuge (NWR)
  is currently an overlay refuge managed through cooperative agreement with the U.S.
  Navy. The refuge is located near the west end of the Hawaiian archipelago approximately
  1250 miles northwest of Honolulu. The Navy is in the process of closing the base
  and completing environmental cleanup. The Navy has established June of 1997 as their
  target date for departure from Midway, at which time they plan to transfer the lands
  and waters to the U.S. Fish and Wildlife Service (Service) for continued management
  as a refuge. Management of Midway Atoll NWR will be a complicated operation for
  the Service due to its extremely remote location. It is imperative that the Service
  act quickly to determine its facility and infrastructure needs at Midway and to
  implement these plans prior to the departure of the Navy when certain economies
  will disappear. This plan outlines proposed refuge objectives, staffing, facilities,
  infrastructure, and funding requirements for implementation. The plan envisions
  partnerships with researchers, the Coast Guard, and airport and eco-tourism vendors\",\n\t\"license_title\":
